var fruitObj=function(){this.alive=[];this.x=[];this.y=[];this.l=[];this.spd=[];this.fruitType=[];this.orange=new Image();this.blue=new Image()};fruitObj.prototype.num=30;fruitObj.prototype.init=function(){for(var a=0;a<this.num;a++){this.alive[a]=false;this.x[a]=0;this.y[a]=0;this.l[a]=0;this.spd[a]=Math.random()*0.017+0.003;this.fruitType[a]=""}this.orange.src="./src/fruit.png";this.blue.src="./src/blue.png"};fruitObj.prototype.draw=function(){for(var b=0;b<this.num;b++){if(this.alive[b]){if(this.fruitType[b]=="blue"){var a=this.blue}else{var a=this.orange}if(this.l[b]<=14){this.l[b]+=this.spd[b]*deltaTime}else{this.y[b]-=this.spd[b]*7*deltaTime}ctx2.drawImage(a,this.x[b]-this.l[b]*0.5,this.y[b]-this.l[b]*0.5,this.l[b],this.l[b]);if(this.y[b]<-10){this.alive[b]=false}}}};fruitObj.prototype.born=function(c){var b=Math.floor(Math.random()*ane.num);this.x[c]=ane.x[b];this.y[c]=canHeight-ane.len[b];this.l[c]=0;this.alive[c]=true;var a=Math.random();if(a<0.2){this.fruitType[c]="blue"}else{this.fruitType[c]="orange"}};fruitObj.prototype.dead=function(a){this.alive[a]=false};function fruitMonitor(){var a=0;for(var b=0;b<fruit.num;b++){if(fruit.alive[b]){a++}}if(a<15){sendFruit();return}}function sendFruit(){for(var a=0;a<fruit.num;a++){if(!fruit.alive[a]){fruit.born(a);return}}};